import React from 'react';
import { Link } from 'react-router-dom';
import './Footer.css';

const Footer = () => {
    return (
        <footer className="footer">
            <div className="footer-content">
                <ul className="footer-links">
                    <li><Link to="/quienes-somos">A</Link></li>
                    <li><Link to="/servicios">Servicios</Link></li>
                    <li><Link to="/trabaja-con-nosotros">Trabaja con nosotros</Link></li>
                    <li><Link to="/empresas-asociadas">Empresas asociadas</Link></li>
                </ul>
                <p className="footer-text">2024 Env√≠a Ya. Todos los derechos reservados</p>
            </div>
        </footer>
    );
};

export default Footer;
